import React, { Component } from 'react';
import { connect } from 'react-redux';
import './Specialty.scss';
class About extends Component {
    render() {
        return (
           <div className='section-share section-about'>
             <div className='section-about-header'>
                 Project Nien Luan KTPM
             </div>
             <div className='section-about-content'>
                 <div className='section-content-left'>
                    <iframe 
                        width="956" 
                        height="538" src="https://www.youtube.com/embed/OlZjYlM5NeY" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
                 </div>
                 <div className='section-content-right'>

                 </div>
             </div>
           </div>
        );
    }

} 

const mapStateToProps = state => {
    return {
        isLoggedIn: state.user.isLoggedIn,
        language: state.app.language,
    };
    
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(About);
